    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

:root {

--text-font-family: Karla;
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: 'Barlow Condensed';
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Source Code Pro';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 1.15rem;
--code-font-size: 0.9rem;
--code-inline-font-size: 1.15em;
--header-h1-font-size: 2.75rem;
--header-h2-font-size: 2.25rem;
--header-h3-font-size: 1.75rem;

--text-color: #292f36;
--header-color: #832020;
--background-color: #faf2ed;
--link-color: #1e2f23;
--text-bold-color: #F28123;
--code-highlight-color: #c9b8a1;
--inverse-text-color: #faf2ed;
--inverse-background-color: #1e2f23;
--inverse-header-color: #faf2ed;
--inverse-link-color: #faf2ed;
--title-slide-background-color: #87b37a;
--title-slide-text-color: #000000;
--header-background-color: #832020;
--header-background-text-color: #faf2ed;
--primary: #87b37a;
--secondary: #1e2f23;
--white: #FFFFFF;
--black: #000000;
--red: #ef3e36;
--purple: #922d50;
--orange: #f28123;
--green: #34623f;
--blue: #004e98;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: 400;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 600;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 1.25rem;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #1e2f23;
background-color: #F0E0DE;
padding: 2px;
}
.remark-slide-number {
color: #87b37a;
opacity: 1;
font-size: 0.9em;
}

## Thigh muscle strength is &lt;u&gt;not&lt;/u&gt; meaningfully linked to long-term self-reported knee symptoms after ACL reconstruction

.font70[**Michael Girdwood**, Brooke Patterson, Kay Crossley, Luke Perraton, Adam Bryant, &lt;bR&gt; Ebonie Rio, Adam Culvenor]

.pull-left[
.font70[SMA Conference 2023]

]

---

class: inverse, middle

## Research Question: 

&gt; - What is the relationship between thigh muscle strength measured at 1 year post ACLR and self-reported outcomes at 1, 3, 5 and 11 years?

&gt; 

---


## Methods - Participants

.center[
**Prospective Cohort Study**]

.pull-left[
.content-box[
- 123 men and women 
- Aged 18-50 years

- Recruited at 1 year post-ACLR
- ACLR with hamstring graft from 2 Melbourne surgeons

]

]

.pull-right[


- No structured rehabilitation

- Measured at 1, 3, 5 and 11 years .font60[(Culvenor, 2016, 2017; Patterson 2018, 2019, 2020)]


 &lt;br&gt;
 
 .right[
&lt;img src = &quot;data:image/png;base64,#koala.png&quot;, width = &quot;70%&quot; /&gt;
]
]

---

## Methods - Strength Assessment


.pull-left[

&lt;br&gt;
&lt;br&gt;
#### Peak isometric &lt;br&gt;**quadriceps** (knee extension) and **hamstring** (knee flexion) torque

]

.pull-right[
&lt;img src = &quot;biodex.jpg&quot;, width = &quot;65%&quot;&gt;
]

---

## Methods - Strength Assessment


.pull-left[

&lt;br&gt;
&lt;br&gt;

#### Peak isometric &lt;br&gt;**quadriceps** (knee extension) and **hamstring** (knee flexion) torque


Sub-group only &lt;br&gt;
(n = 47 completed)
]

.pull-right[

&lt;img src = &quot;biodex.jpg&quot;, width = &quot;65%&quot;&gt;
]

---

## Methods - Strength Assessment

.pull-left[
&lt;img src = &quot;olr_2.png&quot;, width = &quot;65%&quot;&gt;

]

.pull-right[
&lt;br&gt;
&lt;br&gt;
&lt;br&gt;
#### One leg rise test 
Maximal repetitions to failure, paced to 45bpm metronome.

A proxy of thigh muscle strength .font60[(West, 2023)]
]

---

## Methods - Self-reported outcomes

 
.pull-left[
#### Knee Osteoarthritis Outcome Score - KOOS
KOOS&lt;sub&gt;4&lt;/sub&gt; - .font70[Average of Pain, Symptoms, Sport &amp; Recreation, Quality of Life subcales]
]

.pull-right-1[
&lt;img src = &quot;flowchart.png&quot; width = 75%&gt;
]
&lt;br&gt;

--

.pull-left[
#### Data-analysis
- Beta-regressions modelled the relationship between muscle strength and self-reported outcomes at 1, 3, 5 and 11 years, controlling for age, gender and BMI.
]

---

## Results - The Population
.pull-left[

&lt;br&gt;

|  | n = 123 |
|--|--|
|Women (%)| 43 (35%) |
|Age (years) | 29.9 (8.8) |
|BMI (kg/m&lt;sup&gt;2&lt;/sup&gt;) | 26.1 (3.9) |
|Quadriceps Strength &lt;br&gt;(MVIC - Nm) | 148.9 (60.4) |
|Hamstrings Strength &lt;br&gt;(MVIC - Nm) | 73.0 (23.8) |
|Quadriceps strength &lt;br&gt;One Leg Rises (Reps) | 27 (IQR 12 to 50)) |
|Baseline KOOS&lt;sub&gt;4&lt;/sub&gt;| 81.1 (11.5)
.center[
.font60[Mean (SD) unless specified]
]
]

class: middle

## Key Summary

.content-box[

- .blue[Quadriceps muscle] strength and .purple[one-leg rise] performance **were not** associated with future self-reported function after ACLR

- Modest relationships between better hamstring strength and better KOOS4 score at 5 and 11 years  **.black[might not be clinically meaningful**]

- Other non-physical factors may be more important to longer term knee health

]    

---
